def solve(S, ans, N):
    f = False
    ff = False
    for i in range(1, N):
        if i == N - 1:
            if S[i] == "o" and ans[i] == "S":
                if ans[i - 1] == ans[0]:
                    f = True
            if S[i] == "o" and ans[i] == "W":
                if ans[i - 1] != ans[0]:
                    f = True
            if S[i] == "x" and ans[i] == "S":
                if ans[i - 1] != ans[0]:
                    f = True
            if S[i] == "x" and ans[i] == "W":
                if ans[i - 1] == ans[0]:
                    f = True
        elif i == N - 2:
            if S[i] == "o" and ans[i] == "S":
                if ans[i - 1] == ans[i + 1]:
                    ff = True
            if S[i] == "o" and ans[i] == "W":
                if ans[i - 1] != ans[i + 1]:
                    ff = True
            if S[i] == "x" and ans[i] == "S":
                if ans[i - 1] != ans[i + 1]:
                    ff = True
            if S[i] == "x" and ans[i] == "W":
                if ans[i - 1] == ans[i + 1]:
                    ff = True
        else:
            if S[i] == "o" and ans[i] == "S":
                ans[i + 1] = ans[i - 1]
            if S[i] == "o" and ans[i] == "W":
                if ans[i - 1] == "S":
                    ans[i + 1] = "W"
                else:
                    ans[i + 1] = "S"
            if S[i] == "x" and ans[i] == "S":
                if ans[i - 1] == "S":
                    ans[i + 1] = "W"
                else:
                    ans[i + 1] = "S"
            if S[i] == "x" and ans[i] == "W":
                ans[i + 1] = ans[i - 1]

    return f and ff, ans


